import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const DetailedResultPage = () => {
  const { id } = useParams(); // Gets the ID from the URL
  const [details, setDetails] = useState(null);

  useEffect(() => {
    const fetchDetails = async () => {
      try {
        const response = await axios.get(`http://127.0.0.1:5000/api/details/${id}`);
        setDetails(response.data);
      } catch (error) {
        console.error('Error fetching details:', error);
      }
    };

    fetchDetails();
  }, [id]);

  if (!details) return <p>Loading...</p>;

  return (
    <div>
      <img src={`http://127.0.0.1:5000/images/${details[1]}`} alt="Scan Detail" />
      {/* Render other details similarly */}
    </div>
  );
};

export default DetailedResultPage;
